var appMod=angular.module("ngOutstandingApp",[]);
appMod.controller("ngBodyController",["$scope","$http",function($scope,$http){var api="/api/get-outstanding-data";var postData=null;$http.post(api,postData).success(function(data,status,headers,config){$scope.comps=data;$scope.statusNote=""}).error(function(data,status,headers,config){$scope.statusNote="There was an error. Thats all there is to it. Please try again after some time"});$scope.subtotal=function(comp){var total=0;for(var i=0,len=comp.bills.length;i<len;i++)total+=parseInt(comp.bills[i]["ba"]);
return total}}]);
